import { useEffect } from "react";

export const Test = () => {
  useEffect(() => {
    try {
      fetch("http://localhost:3000/api", {
        method: "GET",
      }).then((res) => console.log(res.json()));
    } catch (error) {
      console.log("error =>", error);
    }
  }, []);

  return <h1>Test</h1>;
};
